import React, { useEffect, useState } from "react";
import { Routes, Route, Navigate, useLocation } from "react-router-dom";

import Navbar from "./components/Navbar";
import CategoryNavbar from "./components/CategoryNavbar";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import UploadPrescription from "./pages/UploadPrescription";
import PharmacistDashboard from "./pages/PharmacistDashboard";
import Unauthorized from "./pages/Unauthorized";
import Medicines from "./pages/Medicines";
import BuyMedicine from "./pages/BuyMedicine";
import MedicineManager from "./pages/MedicineManager";
import UserProfile from "./components/UserProfile";
import UploadMedicine from "./pages/UploadMedicine";
import Checkout from "./pages/Checkout";
import PrescriptionStatus from "./pages/PrescriptionStatus";
import VitaminsPage from "./components/VitaminsPage";
import Cart from "./pages/Cart";
import api from "./api/axios";
import "./App.css";
import "./index.css";

// Personal Care
import PersonalCare from "./components/personalcare/PersonalCare";
import SkinCare from "./components/personalcare/SkinCare";
import HairCare from "./components/personalcare/HairCare";
import BabyMomCare from "./components/personalcare/BabyMomCare";
import OralCare from "./components/personalcare/OralCare";
import ElderlyCare from "./components/personalcare/ElderlyCare";

// Health Conditions
import HealthCondition from "./components/healthcondition/HealthCondition";
import BoneJointCare from "./components/healthcondition/BoneJointCare";
import DigestiveCare from "./components/healthcondition/DigestiveCare";
import EyeCare from "./components/healthcondition/EyeCare";
import PainRelief from "./components/healthcondition/PainRelief";
import SmokingCessation from "./components/healthcondition/SmokingCessation";
import LiverCare from "./components/healthcondition/LiverCare";
import ColdCough from "./components/healthcondition/ColdCough";
import HeartCare from "./components/healthcondition/HeartCare";
import KidneyCare from "./components/healthcondition/KidneyCare";
import RespiratoryCare from "./components/healthcondition/RespiratoryCare";
import MentalWellness from "./components/healthcondition/MentalWellness";
import DermaCare from "./components/healthcondition/DermaCare";

export default function App() {
  const [scrolled, setScrolled] = useState(false);
  const [user, setUser] = useState(undefined);
  const [token, setToken] = useState(null);
  const [query, setQuery] = useState("");
  const [suggestions, setSuggestions] = useState([]);
  const [selectedMedicineId, setSelectedMedicineId] = useState(null);

  const location = useLocation();

  // ✅ Robust session restoration
  const syncSession = () => {
    const rawUser = localStorage.getItem("user");
    const rawToken = localStorage.getItem("token");

    console.log("📦 Raw user:", rawUser);
    console.log("📦 Raw token:", rawToken);

    if (!rawUser || !rawToken) {
      console.warn("⚠️ Session not found or invalid");
      setUser(null);
      setToken(null);
      return;
    }

    try {
      const parsedUser = JSON.parse(rawUser);
      if (parsedUser && parsedUser._id && typeof rawToken === "string" && rawToken.length > 10) {
        console.log("✅ Session restored:", parsedUser);
        setUser(parsedUser);
        setToken(rawToken);
      } else {
        console.warn("⚠️ Parsed session invalid");
        setUser(null);
        setToken(null);
      }
    } catch (err) {
      console.error("❌ Failed to parse session:", err.message);
      setUser(null);
      setToken(null);
    }
  };

  useEffect(() => {
    syncSession(); // ✅ Trigger on initial mount and route change
  }, [location]);

  useEffect(() => {
    window.addEventListener("storage", syncSession);
    return () => window.removeEventListener("storage", syncSession);
  }, []);

  useEffect(() => {
    console.log("👤 User state updated:", user);
    console.log("🔐 Token state updated:", token);
  }, [user, token]);

  // ✅ Scroll detection
  useEffect(() => {
    const handleScroll = () => setScrolled(window.scrollY > 100);
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  // ✅ Navbar height sync
  useEffect(() => {
    const syncNavbarHeight = () => {
      const navbar = document.querySelector(".navbar");
      if (navbar) {
        const height = navbar.offsetHeight;
        document.documentElement.style.setProperty("--main-navbar-height", `${height}px`);
      }
    };
    syncNavbarHeight();
    window.addEventListener("resize", syncNavbarHeight);
    return () => window.removeEventListener("resize", syncNavbarHeight);
  }, []);

  // ✅ Medicine search suggestions
  useEffect(() => {
    const fetchSuggestions = async () => {
      if (query.trim().length < 2) {
        setSuggestions([]);
        return;
      }

      try {
        const res = await api.get("/medicines/search", { params: { q: query } });
        setSuggestions(res.data || []);
      } catch (err) {
        console.error("❌ Search error:", err.message);
      }
    };

    const debounce = setTimeout(fetchSuggestions, 300);
    return () => clearTimeout(debounce);
  }, [query]);

  // ✅ Show loading screen while session is undefined
  if (user === undefined) {
    return (
      <div className="container my-5 text-center">
        <h4 className="text-muted">Initializing user session...</h4>
      </div>
    );
  }

  // ✅ You can now continue with your <Routes> and layout rendering below
  return (
    <>
      <Navbar user={user} />
      <CategoryNavbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login setUser={setUser} setToken={setToken} />} />
        <Route path="/register" element={<Register />} />
        <Route path="/upload-prescription" element={<UploadPrescription user={user} token={token} />} />
        <Route path="/pharmacist-dashboard" element={<PharmacistDashboard user={user} token={token} />} />
        <Route path="/unauthorized" element={<Unauthorized />} />
        <Route path="/medicines" element={<Medicines />} />
        <Route path="/buy/:id" element={<BuyMedicine user={user} token={token} />} />
        <Route path="/medicine-manager" element={<MedicineManager user={user} token={token} />} />
        <Route path="/upload-medicine" element={<UploadMedicine user={user} token={token} />} />
        <Route path="/checkout" element={<Checkout user={user} token={token} />} />
        <Route path="/prescription-status" element={<PrescriptionStatus user={user} token={token} />} />
        <Route path="/vitamins" element={<VitaminsPage />} />
        <Route path="/cart" element={<Cart user={user} token={token} />} />

        {/* Personal Care */}
        <Route path="/personal-care" element={<PersonalCare />} />
        <Route path="/skin-care" element={<SkinCare />} />
        <Route path="/hair-care" element={<HairCare />} />
        <Route path="/baby-mom-care" element={<BabyMomCare />} />
        <Route path="/oral-care" element={<OralCare />} />
        <Route path="/elderly-care" element={<ElderlyCare />} />

        {/* Health Conditions */}
        <Route path="/health-conditions" element={<HealthCondition />} />
        <Route path="/bone-joint-care" element={<BoneJointCare />} />
        <Route path="/digestive-care" element={<DigestiveCare />} />
        <Route path="/eye-care" element={<EyeCare />} />
        <Route path="/pain-relief" element={<PainRelief />} />
        <Route path="/smoking-cessation" element={<SmokingCessation />} />
        <Route path="/liver-care" element={<LiverCare />} />
        <Route path="/cold-cough" element={<ColdCough />} />
        <Route path="/heart-care" element={<HeartCare />} />
        <Route path="/kidney-care" element={<KidneyCare />} />
        <Route path="/respiratory-care" element={<RespiratoryCare />} />
        <Route path="/mental-wellness" element={<MentalWellness />} />
        <Route path="/derma-care" element={<DermaCare />} />

      {/* Vitamins */}
      <Route path="/vitamins" element={<VitaminsPage />} />

      {/* Fallback */}
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>

    {/* ✅ Redirect to selected medicine from search */}
    {selectedMedicineId && (
      <Navigate to={`/buy/${selectedMedicineId}`} replace />
    )}

    {/* ✅ Search Suggestions */}
    {suggestions.length > 0 && (
      <div className="container search-suggestions-container mt-4">
        <h5 className="mb-3 text-primary">
          Showing results for: <span className="text-dark">{query}</span>
        </h5>
        <div className="row">
          {suggestions.map((med) => (
            <div key={med._id} className="col-md-4 mb-4">
              <div className="medicine-card h-100 d-flex flex-column justify-content-between p-3 border rounded shadow-sm">
                <div>
                  <h6 className="fw-bold">{med.name}</h6>
                  <p><strong>Category:</strong> {med.category}</p>
                  <p><strong>Symptoms:</strong> {med.symptoms?.join(", ")}</p>
                  <p className="text-muted small">{med.description}</p>
                  <p><strong>Price:</strong> ₹{med.price}</p>
                </div>
                <button
                  className="btn btn-outline-primary mt-3"
                  onClick={() => {
                    setSelectedMedicineId(med._id);
                    window.scrollTo({ top: 0, behavior: "smooth" });
                  }}
                >
                  View
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    )}
  </>
);
}
